import React from "react";
import { Badge } from "react-bootstrap";
import { Testimonials } from "../dataProduct/dataProduct";

const TestimonialBadge = () => {
  const Totalbadge = Testimonials.reduce((acc , Testimoni) => {
    return acc + Testimoni.badGe;
  } , 0);

  return <Badge bg="secondary">{Totalbadge}</Badge>;
};

export default TestimonialBadge;
